        return new Source("{% extends 'base.html.twig' %}

{% block title %}Créer son compte{% endblock %}

{% block stylesheets %}
    <link href=\"https://cdn.jsdelivr.net/npm/bootstrap@5.0.2/dist/css/bootstrap.min.css\" rel=\"stylesheet\"
          integrity=\"sha384-EVSTQN3/azprG1Anm3QDgpJLIm9Nao0Yz1ztcQTwFspd3yD65VohhpuuCOmLASjC\" crossorigin=\"anonymous\">
{% endblock %}

{% block javascripts %}
    <script src=\"https://cdn.jsdelivr.net/npm/bootstrap@5.0.2/dist/js/bootstrap.bundle.min.js\"
            integrity=\"sha384-MrcW6ZMFYlzcLA8Nl+NtUVF0sA7MsXsP1UyJoMp4YLEuNSfAP+JcXn/tWtIaxVXM\"
            crossorigin=\"anonymous\"></script>
{% endblock %}

{% block body %}
    {# TODO Front : bootstrap casse le css / js de la navbar, certainement besoin de rename des classes etc... #}

    <h1 class=\"text-center my-4\">Créer son compte</h1>

    {% form_theme registrationForm 'bootstrap_5_layout.html.twig' %}

    <div class=\"container\">
        {{ form_start(registrationForm) }}
        <h2>Informations de connexion</h2>
        <div class=\"row\">
            {{ form_row(registrationForm.email) }}
        </div>
        <div class=\"row\">
            {{ form_row(registrationForm.plainPassword) }}
        </div>

        <h2>Informations personnelles</h2>
        <div class=\"row\">
            <div class=\"col-md-6\">
                {{ form_row(registrationForm.firstName) }}
            </div>
            <div class=\"col-md-6\">
                {{ form_row(registrationForm.lastName) }}
            </div>
        </div>
        <div class=\"row\">
            {{ form_row(registrationForm.phoneNumber) }}
        </div>
        <div class=\"row\">
            {{ form_row(registrationForm.shippingAddress) }}
        </div>
        <div class=\"row\">
            {{ form_row(registrationForm.billingAddress) }}
        </div>
        <div class=\"row\">
            {{ form_row(registrationForm.agreeTerms) }}
        </div>

        <button type=\"submit\" class=\"btn btn-success mb-5\">Envoyer</button>
        {{ form_end(registrationForm) }}
    </div>

{% endblock %}
", "registration/register.html.twig", "/home/benj/Bureau/Sites/SYMFONY/cafe.com-cda20229/templates/registration/register.html.twig");
